import { Nav } from "react-bootstrap";

const Menu = () => {

    return (
        <header>
            <Nav className="navbar navbar-style">
                <div className="container">
                    <div className="navbar-header">
                        <button type="button" className="navbar-toggle" data-toggle="collapse" data-target="#clps">
                            
                        </button>
                    </div>
                </div>
            </Nav>
        </header>
        
    )
}

export default Menu;
